'use strict';

defineParticle(({DomParticle}) => {

  let template = `
<style>
  [mustaches] {
    display: flex;
    position: relative;
    margin-top: 15px;
  }
  [mustaches] [moustache] {
    display: inline-block;
    margin-right: 5px;
  }
  [mustaches] img {
    cursor: pointer;
  }
</style>
<div mustaches>
  <x-list items="{{mustaches}}">
    <template>
      <div moustache>
        <img src="{{src}}" height="24px" width="42px" key="{{i}}" on-click="_onClick"></img>
      </div>
    </template>
  </x-list>
</div>
  `.trim();

  let mustaches = [
    '',
    '',
    '',
    '',
    '',
  ];

  return class extends DomParticle {
    get template() {
      return template;
    }
    _getImgSrc(mustache) {
      return `data:image/png;base64,${mustache}`;
    }
    willReceiveProps(props) {
      if (props.me && props.messages) {
        this._setState({
          me: props.me,
          messages: props.messages,
        });
      }
    }
    render(props, state) {
      if (state.messages) {
        return {
          mustaches: mustaches.map((m, i) => { return {i, src: this._getImgSrc(m)}; }),
        };
      }
    }
    _onClick(e, state) {
      const Message = this.handles.get('messages').entityClass;
      this.handles.get('messages').store(new Message({
        name: state.me.name,
        type: 'mustache',
        userid: state.me.id,
        time: new Date().toLocaleString(),
        content: this._getImgSrc(mustaches[e.data.key])}));
    }
  };
});
